import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const _=JSON.parse(`{"title":"§ 51.1-511 Persons entitled to payment of insurance on employee's death.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/51.1-511.md","filePath":"vacode/51.1-511.md"}`),n={name:"vacode/51.1-511.md"},r=o('<h1 id="§-51-1-511-persons-entitled-to-payment-of-insurance-on-employee-s-death" tabindex="-1">§ 51.1-511 Persons entitled to payment of insurance on employee&#39;s death. <a class="header-anchor" href="#§-51-1-511-persons-entitled-to-payment-of-insurance-on-employee-s-death" aria-label="Permalink to &quot;§ 51.1-511 Persons entitled to payment of insurance on employee&#39;s death.&quot;">​</a></h1><p>Any amount of group life, accidental death, and dismemberment insurance in force on any employee at the date of his death shall be paid, upon the establishment of a valid claim therefor, to the beneficiary designated by the employee under the provisions of the Virginia Retirement System or other retirement system administered by the Board, unless the employee has designated and filed with the Board on a form prepared by the Board, a different beneficiary of his group life, accidental death, and dismemberment insurance. If no beneficiary has been designated by the employee, or if the death of the designated person occurs prior to the death of the member and another designation has not been made, the proceeds shall be paid to the persons surviving at the date of his death, in the same order of precedence as set forth in subsection A of § <a href="http://law.lis.virginia.gov/vacode/51.1-162/" target="_blank" rel="noreferrer">51.1-162</a>.</p><p>Payment which otherwise would be made to the estate of an employee may be made in accordance with the provisions of § <a href="http://law.lis.virginia.gov/vacode/64.2-601/" target="_blank" rel="noreferrer">64.2-601</a> or <a href="http://law.lis.virginia.gov/vacode/64.2-602/" target="_blank" rel="noreferrer">64.2-602</a>.</p><p>1960, c. 604, § 51-111.67:10; 1986, c. 474; 1990, c. 832; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0313" target="_blank" rel="noreferrer">313</a>; 2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0269" target="_blank" rel="noreferrer">269</a>.</p>',4),i=[r];function s(d,h,l,c,p,f){return t(),a("div",null,i)}const g=e(n,[["render",s]]);export{_ as __pageData,g as default};
